MATCH (p:Payer {id: 'd18ef2e6-ef40-324c-be54-34a5ee865625'})-[:HAS_COVERED]->(e:Encounter)
WITH p, AVG(e.qols_avg) AS avgQoL
RETURN avgQoL;

